import React from 'react';
import { Modal, Button, ModalHeader, ModalBody, ModalFooter } from 'reactstrap';


 
    const ModalTest = props => {  
        
        const { modal } = this.props;
        
     return(
        <div>
    
                <Modal modal={modal} centered>
                    <ModalHeader className="modal-header">
                        {props.name} {props.surname}
                    </ModalHeader>
                    <ModalBody>
                        <h5>Addresse: </h5><p>{props.address}</p>
                        <h5>Ville: </h5><p>{props.city}</p>
                        <h5>Tel: </h5><p>{props.phone}</p>
                        <h5>Email: </h5><p>{props.email}</p>
                        <h6>informations: </h6><p>{props.info}</p>
                    </ModalBody>
                    <ModalFooter>
                        <Button color="danger" onClick={e => this.handleDeleteCustomer(e)} >Supprimer</Button>
                    </ModalFooter>
            </Modal>
        </div>
     )
    }

export default ModalTest
